'''
1020. Number of Enclaves
https://leetcode.com/problems/number-of-enclaves/
'''

class Solution(object):
  def getEdgeSquares(self, A):
    edge_squares = set()
    # Top row
    for j in range(len(A[0])):
      i = 0
      if A[i][j] == 1: edge_squares.add((i, j))
    # Right column
    for i in range(len(A)):
      j = len(A[0]) - 1
      if A[i][j] == 1:edge_squares.add((i, j))
    # Botton row
    for j in range(len(A[0])):
      i = len(A) - 1
      if A[i][j] == 1: edge_squares.add((i, j))
    # Left column
    for i in range(len(A)):
      j = 0
      if A[i][j] == 1:edge_squares.add((i, j))
    return edge_squares

  def sinkCape(self, A, cape, cape_set):
    queue = []
    queue.append(cape)
    while queue:
      (current_i, current_j) = queue.pop(0)
      A[current_i][current_j] = 0
      neighbours = [(current_i - 1, current_j),
                    (current_i + 1, current_j),
                    (current_i, current_j - 1),
                    (current_i, current_j + 1)
                    ]
      for neighbour in neighbours:
        (neighbour_i, neighbour_j) = neighbour
        if 0 <= neighbour_i < len(A) and \
           0 <= neighbour_j < len(A[0]) and \
           A[neighbour_i][neighbour_j] == 1:
          queue.append((neighbour_i, neighbour_j))

  def sinkCapes(self, A, cape_set):
    for cape in cape_set:
      self.sinkCape(A, cape, cape_set)
    return A

  def numEnclaves(self, A):
    """
    :type A: List[List[int]]
    :rtype: int
    """
    edge_squares = self.getEdgeSquares(A)
    # https://www.merriam-webster.com/dictionary/cape
    A = self.sinkCapes(A, edge_squares)
    islands = 0
    for i in range(len(A)):
      for j in range(len(A[0])):
        if A[i][j] == 1: islands += 1
    return islands

